import re
from typing import Dict

def main(input: str) -> Dict[str, str]:
    result = {}
    pattern = r'<th>(.*?)</th>\s*<td>(.*?)</td>'
    matches = re.findall(pattern, input)
    for key, value in matches:
        result[key] = value
    return result

